import React from 'react'
import {connect} from 'react-redux'
import { getItems } from '../actions';

class Tech extends React.Component {

    componentDidMount(){
        this.props.getItems()
    }
    render(){
    return(
        <div>
               {this.props.tech.map((i) => {
                  return(
                    <div>
                        <h2>{i.name}</h2>
                        <h2>${i.cost}</h2>
                        <h2>{i.description}</h2>
                        <h2>{i.user}</h2>
                        <img src={i.picture} alt='its a penis' />
                    </div>      
                  )
               })}
        </div>

    )
    }
}

const mapStateToProps = (state) => {
    return({
      ...state,
      tech: state.tech,

    })
  }

  export default connect(mapStateToProps, {getItems})(Tech);
